import React, { useEffect, useState } from "react";
import jsPDF from "jspdf";
import API from "../utils/api";

function Report() {
  const [reports, setReports] = useState([]);
  const [selectedReport, setSelectedReport] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [search, setSearch] = useState("");
  const [careerFilter, setCareerFilter] = useState("");

  useEffect(() => {
    fetchReports();
  }, [page, search, careerFilter]);

  const fetchReports = async () => {
    try {
      let url = `/reports?page=${page}&limit=5`;
      if (search) url += `&search=${search}`;
      if (careerFilter) url += `&career=${careerFilter}`;

      const res = await API.get(url);
      setReports(res.data?.data || []);
      setTotalPages(res.data?.totalPages || 1);
    } catch {
      setReports([]);
    }
  };

  const generateReport = async () => {
    setLoading(true);
    setError("");

    try {
      const res = await API.post("/reports/generate");
      setSelectedReport(res.data);
      fetchReports();
    } catch {
      setError("Complete all 5 quizzes first!");
    } finally {
      setLoading(false);
    }
  };

  const generatePDF = (report) => {
    const doc = new jsPDF();
    doc.text(report.title || "Report", 10, 20);

    let y = 30;
    report.careers?.forEach((career, i) => {
      doc.text(`${i + 1}. ${career}`, 15, y);
      y += 8;
    });

    doc.text("Roadmap:", 10, y + 10);
    doc.text(doc.splitTextToSize(report.roadmap || "", 180), 15, y + 20);

    doc.save("Career_Report.pdf");
  };

  if (loading) return <h3>Generating Report...</h3>;

  if (selectedReport) {
    return (
      <div>
        <button onClick={() => setSelectedReport(null)}>â¬… Back</button>
        <h2>{selectedReport.title}</h2>

        <h3>Careers:</h3>
        <ul>
          {selectedReport.careers?.map((c, i) => (
            <li key={i}>{c}</li>
          ))}
        </ul>

        <h3>Roadmap:</h3>
        <pre>{selectedReport.roadmap}</pre>

        <button onClick={() => generatePDF(selectedReport)}>Download PDF</button>
      </div>
    );
  }

  return (
    <div>
      <h2>Your Reports</h2>
      <button onClick={generateReport}>Generate New Report</button>
      {error && <p style={{ color: "red" }}>{error}</p>}

      <input
        placeholder="Search title..."
        value={search}
        onChange={(e) => setSearch(e.target.value)}
      />

      <div>
        {reports?.map((r) => (
          <div key={r._id} className="card">
            <h4>{r.title}</h4>
            <p>{r.careers?.[0] || "No career"}</p>
            <button onClick={() => setSelectedReport(r)}>View</button>
          </div>
        ))}
      </div>

      {totalPages > 1 && (
        <div>
          <button disabled={page === 1} onClick={() => setPage(page - 1)}>
            Prev
          </button>
          <span> Page {page} of {totalPages} </span>
          <button
            disabled={page === totalPages}
            onClick={() => setPage(page + 1)}>
            Next
          </button>
        </div>
      )}
    </div>
  );
}

export default Report;
